import React, { Component } from "react"
import Draggable from 'react-draggable';
import './symbols.css'
import './style.css'
import './Desktop.js'
import './desktop.css'
import folder from './folder.jpg'

export default function Symbols() {
    let isDragging = false;
    function onDrag(e) {
      console.log("onDrag");
      isDragging = true;
    }
    function onStop(e) {
      console.log("onStop");
      setTimeout(() => (isDragging = false), 0);
    }
    function onClick(e) {
      console.log("onclick");
      console.log({ isDragging });
    }
    return (
      <Draggable
      onStop={onStop} onDrag={onDrag}
      >
          <div id="each-icon" onClick={onClick}>
          <img id="icons-pic"  src={folder} alt="imp"></img>
            <p id="icon-name">{this.props.title}</p>
          </div>
      </Draggable>
    )
};
